    constructor(cmp:CmpFun<T>) {
        this.cmp=cmp
        this.elements=[]
    }

    add(e:T):void {
        if (this.elements.findIndex((f:T)=>this.cmp(e,f)==0)==-1)
            this.elements.push(e)
    }

