        this.elements.sort(this.cmp)
        return this.elements
    }
}

#include <stdio.h>
#include <stdlib.h>

typedef struct ll_struct{
	int dato;
	struct ll_struct* next;
} linkedlist_t;

//Aggiunge un elemento in cima alla lista. Restituisce il nuovo puntatore al primo elemento della lista.
linkedlist_t* add_front(int v, linkedlist_t* head){
	linkedlist_t* new_el = malloc(sizeof(linkedlist_t));
	new_el->dato = v;
	new_el->next = head;
	return new_el;
}

//Aggiunge un elemento in fondo alla lista. Restituisce il nuovo puntatore al primo elemento della lista.
linkedlist_t* add_end(int v, linkedlist_t* head){
	//Creiamo il nuovo elemento, che non ha successore.
	linkedlist_t *node=head, *new_el = malloc(sizeof(linkedlist_t));
	new_el->dato = v;
	new_el->next = NULL;

	if (head == NULL) //Caso speciale: la lista era vuota. Restituiamo come primo elemento della lista quello appena creato.
		return new_el;
	while (node->next != NULL) //Cerchiamo l'ultimo elemento, ovvero quello che non ha successore.
		node = node->next;
	//Aggiungiamo il nuovo elemento in fondo alla lista. Il puntatore al primo elemento della lista non cambia.
	node->next = new_el;
	return head;
}

//Elimina un elemento della lista di valore v. Restituisce il nuovo puntatore al primo elemento della lista.
linkedlist_t* remove_el(int v, linkedlist_t* head){
	linkedlist_t* new_head = NULL;
	linkedlist_t* prec;
	linkedlist_t* curr;
	if (head == NULL) //Caso speciale: la lista e' vuota, non dobbiamo rimuovere niente.
		return NULL;
	else if (head->dato == v){ //Caso speciale: il primo elemento della lista deve essere eliminato. Restituiamo come primo elemento della lista quello che era il secondo elemento.
		new_head = head->next;
		free(head);
		return new_head;
	}
	else{
		prec = head;
		curr = head->next;
		while (curr != NULL){ //Finche' non arriviamo in fondo alla lista...
			if (curr->dato !=v) { //L'elemento corrente non e' quello da eliminare: continuiamo.
				prec = prec->next;
				curr = curr->next;
			}
			else { //L'elemento corrente e' quello da eliminare. Il puntatore al primo elemento della lista non cambia.
				linkedlist_t* new_next = curr->next;
				free(prec->next);
				prec->next = new_next;
				return head;
			}
		}
		return head;
	}
}

//Processa un valore di input.
linkedlist_t* process_input(int v, linkedlist_t* head){
	if (v<0) // v negativo: rimuoviamo -v
		return remove_el(-v, head);
	else if (v%2) // v dispari: aggiungiamo v in fondo
		return add_end(v, head);
	else // v pari: aggiungiamo v in cima
		return add_front(v, head);
}

